COCOSSD = "";

img = "";
object = [];
status = "";

function preload()
{
    img = loadImage("dog_cat.jpg");
}

function setup()
{
    Canvas = createCanvas(640, 500);
    Canvas.center();

    COCOSSD = ml5.objectDetector("cocossd", modelLoadedDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDD);
    document.getElementById("status").innerHTML = "Object detecting";
}

function modelLoadedDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDDD()
{
    console.log("Model has Loadeddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddd pls check if not ");
    status = true;
    COCOSSD.detect(img, gotresultsssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssss);
      
}

function gotresultsssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssss(error, results)
{
    if(error)
    {
        console.error(error);
    }
    else
    {
        console.log(results);
        object = results;
    }
}

function draw()
{
    image(img, 0, 0, 640, 500);

    if( status != "")
    {
        for(var i = 0; i < object.length; i++)
        {
            document.getElementById("status").innerHTML = "Object detected";

            fill(255, 000, 000);
            percent = floor(object[i].confidence * 100);
            text(object[i].label + " " + percent + "%", object[i].x + 15, object[i].y + 15);
            noFill();
            stroke(255, 000, 000);
            rect(object[i].x, object[i].y, object[i].width, object[i].height);
        }
    }
    
}